import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
// import './index.css';
// import App from './App';

import StarRating from './StarRating';

const Test = () => {
  const [movieRating, setMovieRating] = useState(0)
  return (
    <div>
      <StarRating color="blue" maxStar={5} onSetRating={setMovieRating} />
      <p>This movie was rated {movieRating} rating</p>
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* <App />*/}
    <StarRating maxStar={5}
      size={80} color="red"
      messages={['Terrible', 'Bad', 'Ok', 'Good', 'Excellent']}
      defaultRating={3} />
    <Test />
  </React.StrictMode>
);
